import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Calendar = () => {
    const [events, setEvents] = useState([]);
    const [recipes, setRecipes] = useState([]);
    const [shoppingLists, setShoppingLists] = useState([]);

    useEffect(() => {
        fetchRecipes();
        fetchShoppingLists();
    }, []);

    const fetchRecipes = async () => {
        try {
            const response = await axios.get('http://localhost:5000/recipe-list');
            setRecipes(response.data);
        } catch (error) {
            console.error('Erreur lors de la récupération des recettes :', error);
        }
    };

    const fetchShoppingLists = async () => {
        try {
            const response = await axios.get('http://localhost:5000/shopping-list');
            setShoppingLists(response.data);
        } catch (error) {
            console.error('Erreur lors de la récupération des listes de courses :', error);
        }
    };

    const addEvent = (event) => {
        if (event.title) {
            setEvents([...events, event]);
        } else if (event.listTitle) {
            setEvents([...events, event]);
        }
    };

    const removeEvent = (index) => {
        const updatedEvents = [...events];
        updatedEvents.splice(index, 1);
        setEvents(updatedEvents);
    };

    return (
        <div>
            <h2>Calendar</h2>
            <h3>Recipes</h3>
            <ul>
                {recipes.map((recipe) => (
                    <li key={recipe._id}>
                        <div>
                            <h4>{recipe.title}</h4>
                            <p>Temps de préparation : {recipe.prepTime} minutes</p>
                            <p>Temps de cuisson : {recipe.cookTime} minutes</p>
                            <p>Ingrédients :</p>
                            <ul>
                                {recipe.ingredients.map((ingredient, index) => (
                                    <li key={index}>
                                        {ingredient.quantity} {ingredient.unit} de {ingredient.name}
                                    </li>
                                ))}
                            </ul>
                        </div>
                        <button onClick={() => addEvent(recipe)}>Ajouter</button>
                    </li>
                ))}
            </ul>
            <h3>Shopping Lists</h3>
            <ul>
                {shoppingLists.map((list) => (
                    <li key={list._id}>
                        <div>
                            <h4>{list.listTitle}</h4>
                            <p>Éléments :</p>
                            <ul>
                                {list.items.map((item, index) => (
                                    <li key={index}>
                                        {item.quantity} {item.name} ({item.category})
                                    </li>
                                ))}
                            </ul>
                        </div>
                        <button onClick={() => addEvent(list)}>Ajouter</button>
                    </li>
                ))}
            </ul>
            <h3>Events</h3>
            <ul>
                {events.map((event, index) => (
                    <li key={index}>
                        {event.title ? (
                            <div>
                                <h4>{event.title}</h4>
                                <p>Temps de préparation : {event.prepTime} minutes</p>
                                <p>Temps de cuisson : {event.cookTime} minutes</p>
                                <p>Ingrédients :</p>
                                <ul>
                                    {event.ingredients.map((ingredient, index) => (
                                        <li key={index}>
                                            {ingredient.quantity} {ingredient.unit} de {ingredient.name}
                                        </li>
                                    ))}
                                </ul>
                            </div>
                        ) : (
                            <div>
                                <h4>{event.listTitle}</h4>
                                <p>Éléments :</p>
                                <ul>
                                    {event.items.map((item, index) => (
                                        <li key={index}>
                                            {item.quantity} {item.name} ({item.category})
                                        </li>
                                    ))}
                                </ul>
                            </div>
                        )}
                        <button onClick={() => removeEvent(index)}>Supprimer</button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Calendar;
